import React from 'react';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import NavbarBootstrap from 'react-bootstrap/Navbar'; // Renamed to NavbarBootstrap
import NavDropdown from 'react-bootstrap/NavDropdown';

const CustomNavbar = () => {
    return (
        <NavbarBootstrap expand="lg" className="bg-body-tertiary">
            <Container>
                <NavbarBootstrap.Brand href="#home">Sign language translator</NavbarBootstrap.Brand>
                <NavbarBootstrap.Toggle aria-controls="basic-navbar-nav" />
                <NavbarBootstrap.Collapse id="basic-navbar-nav">
                    <Nav className="me-auto">
                        <Nav.Link href="#home">Translator</Nav.Link>
                        <Nav.Link href="#link">Profile</Nav.Link>
                        <Nav.Link href="#link">Log out</Nav.Link>
                    </Nav>
                </NavbarBootstrap.Collapse>
            </Container>
        </NavbarBootstrap>
    );
}

export default CustomNavbar;
